window.bookSummaryJSON = "<p>I finally know who I am, and it terrifies me.</p> <p>Worse, I think it also terrifies my hot vampire boyfriend, Bran Duval.</p> <p>Can we get past the latest revelations about my origins and newfound power? Will Bran ever look at me the same way again?</p> <p>We have to figure things out if we’re to defeat the enemy that’s coming.</p> <p>Because they're closer than we think.</p> <p>NOTE: <i>Hot Vampire Next Door</i> is a Kindle Vella serial. This version is an audio boxset of season four, containing episodes 54-70. The story is considered ongoing, and does not have a scheduled end date. You can expect high heat, lots of twists, and a vampire who realizes he might be a little more protective of his little mouse than he first realized.</p>"; 
